import styled from "styled-components";
import { device } from "../../assets/styles/device";

export const DivHeaderTable = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: flex-start;
  padding-top: 50px;
  align-items: center;
  align-items: center;

  .child-1 {
    font-family: Roboto;
    font-style: normal;
    font-weight: 500;
    font-size: 24px;
    line-height: 28px;
    text-align: center;
    background: #f3f5f8;
    width: 83px;
    height: 88px;
    padding: 30px 0;
  }

  .child-2 {
    margin: 20px;
    font-family: Roboto;
    font-style: normal;
    font-weight: 500;
    font-size: 24px;
    line-height: 28px;
    text-align: left;
    width: 65%;
  }

  .child-3 {
    margin: 20px;
    font-family: Roboto;
    font-style: normal;
    font-weight: 500;
    line-height: 28px;
    text-align: center;
    color: #0089ff;
    width: 10%;
  }

  .child-4 {
    margin: 20px;
    font-family: Roboto;
    font-style: normal;
    font-weight: 500;
    line-height: 28px;
    text-align: center;
    color: #0089ff;
    width: 3%;
  }

  .child-5 {
    margin: 30px;
    font-family: Roboto;
    font-style: normal;
    font-weight: 500;
    line-height: 28px;
    text-align: center;
    color: #0089ff;
    width: 5%;
  }
`;

export const Tr = styled.tr`
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
`;

export const Th = styled.th`
  .img {
    img {
      border-radius: 6px;
      margin: 10px;
      width: 24px;
    }
  }
`;
